import Header from './components/header/header';
import Content from './components/content/content';
import Footer from './components/footer/footer';
import Dialogs from "./components/dialogs/dialogs";
import {BrowserRouter, Route} from "react-router-dom";
const App = (props) => {
  return (

      <BrowserRouter>
          console.log(props);
          debugger;
      <div className="main">
          <Header />
          <div className={classes.container}>
            <Route path = '/dialog' render={()=><Dialogs  appMessage={props.appPosts.message} elements={props.appPosts.elements}/>} />
            <Route path = '/profile' component = {()=><Content posts={props.appPosts.posts} />} />
          </div>
          <Footer />
      </div>
      </BrowserRouter>
  );
}
export default App;
